    const [messages, setMessages] = useState([
        {
            name: 'Ellen',
            image: 'https://livedoor.blogimg.jp/kiraraanime/imgs/b/8/b82d1f45-s.jpg',
            message: 'whats up ♥',
        },
        {
            name: 'Ellen',
            image: 'https://livedoor.blogimg.jp/kiraraanime/imgs/b/8/b82d1f45-s.jpg',
            message: 'How is it going!',
        },
        {
            message: 'Fine thanks ',

        },
    ]);
return(
    <div className="chatscreen">
        <p className="">YOU MATCHED WITH ELLEN ON 10/08/20</p>
        {messages.map( (message) => (
            message.name?(
                <div className="chatScreen_message">
                <Avatar
                className="chatScreen_image"
                alt= {message.name}
                srd={message.image}
                />
                <p className="chatscreen_text">{message.message}</p>
            </div>
            ) : (
                <div className="chatScreen_message">
                <p className="chatScreen_text"></p>
                </div>
            )


        ))}
    </div>
);

}
export default ChatScreen;
